    <details>
      <summary>
        <h6 id="prop-break-after">break-after <a href="#prop-break-after" class="hash-link"> </a></h6>
      </summary>
      <div>
        <div>
          <div id="prop-break-after-syntax">Syntax</div>
          <div class="example">
            <div class="syntax-block">
              <code>break-after: auto | <span class="ext">-prince-prefer</span>? [ avoid | avoid-page | avoid-column ] | column | page | left | right | recto | verso</code>
            </div>
          </div>
        </div>
        <div>
          <div class="example">
            <div class="syntax-block">
              <table class="property-table">
                <tr>
                  <th scope="row">
          Initial value
        </th>
                  <td>
                    <code>auto</code>
                  </td>
                </tr>
                <tr>
                  <th scope="row">
          Applies to
        </th>
                  <td>block-level elements in the normal flow of the root element</td>
                </tr>
                <tr>
                  <th scope="row">
          Inherited
        </th>
                  <td>
                  no
                </td>
                </tr>
              </table>
            </div>
          </div>
        </div>
        <div>
          <div id="prop-break-after-comments">Comments</div>
          <p>
    This property can be used to force or suppress page breaks after an
    element.
    </p>
          <p>
    The values <code>avoid-page</code> and <code>avoid-column</code> each behave
    as simply <code>avoid</code>: it is not possible to avoid page breaks without
    also avoiding column breaks.
    </p>
          <p>
    For <code>avoid*</code> values not preceded by <code>-prince-prefer</code>,
    content before the avoided break will be pushed to the next column or page
    if necessary to avoid breaking there.
    </p>
          <p>
    The keyword <code>-prince-prefer</code> is only accepted by
    <a href="/doc/prince-for-books/">Prince for Books</a>.
    If an <code>avoid*</code> value is preceded by <code>-prince-prefer</code>,
    then Prince for Books will try to avoid breaking there,
    but not at the cost of introducing an obvious gap at the end of the
    previous column or page:
    it will only use whatever flexibility has been granted with
    <code>-<a href="#prop-prince-change-line-breaks-for-pagination">prince-change-line-breaks-for-pagination</a></code>,
    <code>-<a href="#prop-prince-spread-length-options">prince-spread-length-options</a></code>
    or
    <code>-<a href="#prop-prince-resize-options">prince-resize-options</a></code>.
    </p>
          <p>
    See the documentation for <a href="/doc/paged/#page-breaks">Page breaks</a> for more details.
    </p>
        </div>
        <div>
          <div id="prop-break-after-spec">Specification</div>
          <ul>
            <li>
              <a href="https://www.w3.org/TR/css-break-3/#breaking-controls">CSS Fragmentation Module Level 3</a>
            </li>
          </ul>
        </div>
      </div>
    </details>
    <details>
