    <details>
      <summary class="ext" title="Prince extension">
        <h6 id="prop-flow">flow* <a href="#prop-flow" class="hash-link"> </a></h6>
      </summary>
      <div>
        <div>
          <div id="prop-flow-syntax">Syntax</div>
          <div class="example">
            <div class="syntax-block">
              <code>flow: normal | static( <span>&lt;<i>name</i>&gt;</span>, [ start | current ]? )</code>
            </div>
          </div>
        </div>
        <div>
          <div class="example">
            <div class="syntax-block">
              <table class="property-table">
                <tr>
                  <th scope="row">
          Initial value
        </th>
                  <td>
                    <code>normal</code>
                  </td>
                </tr>
                <tr>
                  <th scope="row">
          Applies to
        </th>
                  <td>all elements</td>
                </tr>
                <tr>
                  <th scope="row">
          Inherited
        </th>
                  <td>
                  no
                </td>
                </tr>
              </table>
            </div>
          </div>
        </div>
        <div>
          <div id="prop-flow-comments">Comments</div>
          <p>
    This property is used to remove elements from the normal flow of the
    document, to be placed in a page region with <code><a href="#prop-content">content</a>: flow()</code>,
    in order to create running page headers and footers.
    </p>
          <p>
    The optional <code>start</code> argument (default is <code>current</code>)
    makes the fetched content available, as if it were fetched from the start
    of the document.
    </p>
          <p>
    See the documentation for <a href="/doc/paged/#taking-elements-from-the-document">Taking elements from the document</a> for more details.
    </p>
          <p class="note">
        The property <a href="#prop-prince-flow"><code>-prince-flow</code></a> can be used as an alias.
        </p>
        </div>
        <div>
          <div id="prop-flow-seealso">See Also</div>
          <ul>
            <li>
              <a href="/doc/paged/#page-regions">Page regions</a>
            </li>
            <li>
              <a href="/doc/paged/#taking-elements-from-the-document">Taking elements from the document</a>
            </li>
            <li>
              <code>
                <a href="#prop-content">content</a>
              </code>
            </li>
          </ul>
        </div>
        <div>
          <div id="prop-flow-spec">Specification</div>
          <ul>
            <li>
              <a href="https://books.spec.whatwg.org/#flowing-content-to-a-named-area:-'flow'">CSS Books</a>
            </li>
          </ul>
        </div>
      </div>
    </details>
