    <details>
      <summary>
        <h6 id="prop-grid-template-rows">grid-template-rows <a href="#prop-grid-template-rows" class="hash-link"> </a></h6>
      </summary>
      <div>
        <div>
          <div id="prop-grid-template-rows-syntax">Syntax</div>
          <div class="example">
            <div class="syntax-block">
              <code>grid-template-rows: none | <span>&lt;<i>track-list</i>&gt;</span></code>
            </div>
          </div>
        </div>
        <div>
          <div class="example">
            <div class="syntax-block">
              <table class="property-table">
                <tr>
                  <th scope="row">
          Initial value
        </th>
                  <td>
                    <code>none</code>
                  </td>
                </tr>
                <tr>
                  <th scope="row">
          Applies to
        </th>
                  <td>grid containers</td>
                </tr>
                <tr>
                  <th scope="row">
          Inherited
        </th>
                  <td>
                  no
                </td>
                </tr>
              </table>
            </div>
          </div>
        </div>
        <div>
          <div id="prop-grid-template-rows-comments">Comments</div>
          <p>
    The simple grammar given above should be read with the following definitions:
    </p>
          <p>
    <code>   &lt;<i>track-list</i>&gt; = [ &lt;<i>line-names</i>&gt;? [ &lt;<i>track-size</i>&gt; | &lt;<i>track-repeat</i>&gt; ]]+ &lt;<i>line-names</i>&gt;?
    &lt;<i>track-repeat</i>&gt; = repeat([ &lt;<i>integer</i>[1,∞]&gt; | auto-fill ], &lt;<i>track-list</i>&gt;)
    &lt;<i>track-size</i>&gt; = &lt;<i>track-breadth</i>&gt; | minmax(&lt;<i>track-breadth</i>&gt;, &lt;<i>track-breadth</i>&gt;)
    &lt;<i>track-breadth</i>&gt; = &lt;<i>length-percentage</i>&gt; | &lt;<i>flex</i>&gt; | min-content | max-content | auto</code>
    </p>
          <p>
    The following restrictions apply:
    </p>
          <ul>
    <li>the <code>repeat()</code> function can't be nested;</li>
    <li>you can have at most one <code>auto-fill</code>;</li>
    <li>if you use <code>auto-fill</code> then all track sizes have to be fixed, i.e. not intrinsic or flexible;</li>
    <li>the left argument of the <code>minmax()</code> function cannott be a <code>&lt;<i>flex</i>&gt;</code>.</li>
    </ul>
          <p>
    For further details, and a more formal grammar, please consult the <a href="https://www.w3.org/TR/css-grid-1/#track-sizing">CSS Grid Layout Module Level 1</a> specification.
    </p>
        </div>
        <div>
          <div id="prop-grid-template-rows-seealso">See Also</div>
          <ul>
            <li>
              <a href="/doc/styling/#grid-layout">Grid Layout</a>
            </li>
          </ul>
        </div>
        <div>
          <div id="prop-grid-template-rows-spec">Specification</div>
          <ul>
            <li>
              <a href="https://www.w3.org/TR/css-grid-1/#track-sizing">CSS Grid Layout Module Level 1</a>
            </li>
          </ul>
        </div>
      </div>
    </details>
