    <details>
      <summary class="ext" title="Prince extension">
        <h6 id="prop-margin-alt">margin-alt* <a href="#prop-margin-alt" class="hash-link"> </a></h6>
      </summary>
      <div>
        <div>
          <div id="prop-margin-alt-syntax">Syntax</div>
          <div class="example">
            <div class="syntax-block">
              <code>margin-alt: none | <span>&lt;<i>length</i>&gt;</span> <span>&lt;<i>length</i>&gt;</span>?</code>
            </div>
          </div>
        </div>
        <div>
          <div class="example">
            <div class="syntax-block">
              <table class="property-table">
                <tr>
                  <th scope="row">
          Initial value
        </th>
                  <td>
                    <code>none</code>
                  </td>
                </tr>
                <tr>
                  <th scope="row">
          Applies to
        </th>
                  <td>all top- or bottom-floated elements</td>
                </tr>
                <tr>
                  <th scope="row">
          Inherited
        </th>
                  <td>
                  no
                </td>
                </tr>
              </table>
            </div>
          </div>
        </div>
        <div>
          <div id="prop-margin-alt-comments">Comments</div>
          <p>
        The <code>margin-alt</code> property defines a top and/or bottom margin
        for elements floated to the top or bottom of a page or column,
        by replacing the value of the corresponding margin property.
    </p>
          <p>
    The default value is <code>none</code>, which means that no alternative margin value
    is defined, and thus the default margin, specified with the <code>margin</code>
    property, is applied.
    </p>
          <p>
    If only one value is given, it refers to both the top and bottom alternative margin.
    When two values are given, the first one refers to the top alternative margin, while
    the second one refers to the bottom one.
    </p>
          <p>
    Unlike the <code>margin</code> property, it does not take percentage values.
    </p>
          <p class="note">
        The property <a href="#prop-prince-margin-alt"><code>-prince-margin-alt</code></a> can be used as an alias.
        </p>
        </div>
        <div>
          <div id="prop-margin-alt-seealso">See Also</div>
          <ul>
            <li>
              <a href="/doc/styling/#margins-of-page-and-column-floats">Margins of Page and Column Floats</a>
            </li>
            <li>
              <a href="#prop-margin">
                <code>margin</code>
              </a>
            </li>
          </ul>
        </div>
      </div>
    </details>
