    <details>
      <summary class="ext" title="Prince extension">
        <h6 id="prop-prince-baseline-grid">-prince-baseline-grid* <a href="#prop-prince-baseline-grid" class="hash-link"> </a></h6>
      </summary>
      <div>
        <div>
          <div id="prop-prince-baseline-grid-syntax">Syntax</div>
          <div class="example">
            <div class="syntax-block">
              <code>-prince-baseline-grid: auto | new | none</code>
            </div>
          </div>
        </div>
        <div>
          <div class="example">
            <div class="syntax-block">
              <table class="property-table">
                <tr>
                  <th scope="row">
          Initial value
        </th>
                  <td>
                    <code>auto</code>
                  </td>
                </tr>
                <tr>
                  <th scope="row">
          Applies to
        </th>
                  <td>block-level boxes</td>
                </tr>
                <tr>
                  <th scope="row">
          Inherited
        </th>
                  <td>
                  no
                </td>
                </tr>
              </table>
            </div>
          </div>
        </div>
        <div>
          <div id="prop-prince-baseline-grid-comments">Comments</div>
          <p>Prince does not yet support constraining an element’s baselines to lie on a grid.
    In the meantime, this property suffices for common cases:
    if its value is <code>none</code>
    then space is added around the box to make its border box occupy
    a whole number of grid lines.</p>
          <p>The grid line spacing is established by the closest ancestor
    whose <code>-prince-baseline-grid</code> is <code>new</code>.</p>
          <p>Space is added at the place indicated by <code>-<a href="#prop-prince-resize-adjust">prince-resize-adjust</a></code>.</p>
          <p>Note that the value <code>none</code> currently forces the box to
    “establish a new formatting context”: i.e. its margins will not collapse with
    the margins of its children, even if it has no borders and padding.</p>
          <p>The usual way that this property would be used is
    to set it to <code>new</code> on the root element,
    and to set it to <code>none</code> on headings, blockquotes and tables.</p>
          <p>This property only applies to <a href="/doc/prince-for-books/">Prince for Books</a>.</p>
        </div>
      </div>
    </details>
