        <div>
          <div id="prop-prince-forced-breaks-comments">Comments</div>
          <p>This property controls whether a line ended by a “preserved newline”
	(such as introduced by <code>&lt;br&gt;</code>)
	should preferably appear to be a normal full line (as if ended only by normal line wrapping),
	or whether being shorter than a normal full line is actually preferable,
	for example to mark a deliberate break.</p>
          <p>The difference is particularly marked in justified text,
	where lines ended by <code>-prince-forced-breaks:full</code> are subject to
	justification like most other lines.</p>
          <p class="note">At the time of writing, this property only affects justified text.</p>
          <p>This property only applies to <a href="/doc/prince-for-books/">Prince for Books</a>.</p>
        </div>
        <div>
          <div id="prop-prince-forced-breaks-seealso">See Also</div>
