    <details>
      <summary class="ext" title="Prince extension">
        <h6 id="prop-prince-resize-adjust">-prince-resize-adjust* <a href="#prop-prince-resize-adjust" class="hash-link"> </a></h6>
      </summary>
      <div>
        <div>
          <div id="prop-prince-resize-adjust-syntax">Syntax</div>
          <div class="example">
            <div class="syntax-block">
              <code>-prince-resize-adjust: margin | margin-start | margin-end | padding | padding-start | padding-end</code>
            </div>
          </div>
        </div>
        <div>
          <div class="example">
            <div class="syntax-block">
              <table class="property-table">
                <tr>
                  <th scope="row">
          Initial value
        </th>
                  <td>
                    <code>margin</code>
                  </td>
                </tr>
                <tr>
                  <th scope="row">
          Applies to
        </th>
                  <td>block-level boxes</td>
                </tr>
                <tr>
                  <th scope="row">
          Inherited
        </th>
                  <td>
                  no
                </td>
                </tr>
              </table>
            </div>
          </div>
        </div>
        <div>
          <div id="prop-prince-resize-adjust-comments">Comments</div>
          <p>
    This property controls where space is added for either
    <code>-<a href="#prop-prince-baseline-grid">prince-baseline-grid</a></code>
    or
    <code>-<a href="#prop-prince-resize-options">prince-resize-options</a></code>.
    </p>
          <p>The <code>*-start</code> values adjust space before the box’s content,
    <code>*-end</code> values adjust space after the box’s content,
    while the plain <code>margin</code> and <code>padding</code>
    values add half of the space adjustment before and half after.</p>
          <p class="note">
    The initial value is <code>margin</code>, i.e. the requested adjustment
    is devided equally between top and bottom margin. However, for
    <code>@footnotes</code> region, Prince by default sets this property
    to <code>margin-top</code>.
    </p>
          <p>In particular, if a box is split across more than one page,
    then the adjustment is applied only before the first fragment of that box
    and/or after the last fragment of that box.</p>
          <p>The <code>padding*</code> values adjust space inside the border (if any),
    while the <code>margin*</code> values adjust space outside of the border.</p>
          <p>For the <code>margin*</code> values, there is a difference in behaviour between
    whether the adjustment is for baseline grid or for pagination flexibility:
    <code>-prince-resize-options</code> literally changes the used value of the
    <code><a href="#prop-margin">margin</a></code> properties, so is subject to
    <a href="https://www.w3.org/TR/CSS2/#collapsing-margins">margin collapsing</a>
    and
    <a href="https://www.w3.org/TR/css-break-3/#break-margins">margin truncation</a>,
    and consequently might not affect the resulting collapsed &amp; truncated margin
    by the full amount.</p>
          <p>Whereas baseline grid alignment must add space somewhere,
    so it might best be described as adding space outside of the border rather
    than exactly increasing the used value of <code>margin</code> properties:
    this extra space is not truncated if it occurs immediately after a page break;
    and if space needs to be added to the last fragment of a box split split across
    more than one page, then space can be added at padding-end or margin-end
    even if <code>-prince-resize-adjust</code> is <code>padding-start</code>
    or <code>margin-start</code> respectively.</p>
          <p>This property only applies to <a href="/doc/prince-for-books/">Prince for Books</a>.</p>
        </div>
      </div>
    </details>
    <details>
      <summary class="ext" title="Prince extension">
        <h6 id="prop-prince-resize-options">-prince-resize-options* <a href="#prop-prince-resize-options" class="hash-link"> </a></h6>
      </summary>
      <div>
        <div>
